import Footer from "./components/Footer/Footer";
import fetcher from "./common/movies";

function App() {

  let moviesArr = [];
  useEffect(() => {
    const fetchMovies = async() => {
      moviesArr =  await fetcher.get(`?apikey=e8960dea&s=harry`);
      console.log(moviesArr);
    }
    fetchMovies();
  }, []);



  return (
    <div className='App'>
      <Router>

        <Header></Header>

        <Footer></Footer>

      </Router>
    </div>
  );
}

export default App;
